```scss
import org.springframework.beans.factory.annotation.Autowired;
import org.springframework.boot.autoconfigure.SpringBootApplication;
import org.springframework.statemachine.StateMachine;
import org.springframework.statemachine.config.StateMachineBuilder;

import com.temporal.client.WorkflowClient;
import com.temporal.client.WorkflowOptions;
import com.temporal.worker.Worker;
import com.temporal.worker.WorkerOptions;

@SpringBootApplication
public class Application {

  private static final String MORTGAGE_APPLICATION_WORKFLOW = "MortgageApplicationWorkflow";
  private static final String TASK_QUEUE = "MortgageApplicationTasks";

  @Autowired
  private WorkflowClient workflowClient;

  public static void main(String[] args) throws Exception {
    SpringApplication.run(Application.class, args);
  }

  @PostConstruct
  public void init() throws Exception {
    // Build the state machine
    StateMachine<States, Events> stateMachine = buildStateMachine();

    // Start the Temporal worker
    Worker.Factory.start(workflowClient, TASK_QUEUE, new WorkerOptions.Builder().setIdentity("worker1").build(),
        new MortgageApplicationWorkflow());

    // Start the mortgage application workflow
    WorkflowOptions workflowOptions =
        new WorkflowOptions.Builder().setTaskQueue(TASK_QUEUE).build();
    String workflowId =
        workflowClient.newWorkflowStub(MORTGAGE_APPLICATION_WORKFLOW, workflowOptions).start(stateMachine);
  }

  private StateMachine<States, Events> buildStateMachine() throws Exception {
    StateMachineBuilder.Builder<States, Events> builder = StateMachineBuilder.builder();

    builder.configureStates().withStates().initial(States.SUBMITTED).state(States.UNDER_REVIEW)
        .state(States.APPROVED).state(States.REJECTED);

    builder.configureTransitions().withExternal().source(States.SUBMITTED).target(States.UNDER_REVIEW)
        .event(Events.START_REVIEW).and().withExternal().source(States.UNDER_REVIEW).target(States.APPROVED)
        .event(Events.APPROVE).and().withExternal().source(States.UNDER_REVIEW).target(States.REJECTED)
        .event(Events.REJECT);

    return builder.build();
  }
}

enum States {
  SUBMITTED, UNDER_REVIEW, APPROVED, REJECTED
}

enum Events {
  START_REVIEW, APPROVE, REJECT
}

class MortgageApplicationWorkflow implements Workflow {

  @WorkflowMethod
  public void startWorkflow(StateMachine<States, Events> stateMachine) {
    // Trigger the "Start Review" event to move the state machine to "Under Review" state
    stateMachine.sendEvent(Events.START_REVIEW);
```

